// CountIDs returns the count of ids with FGA batch filtering applied
func (sq *ScanQuery) CountIDs(ctx context.Context) (int, error) {
	logx.FromContext(ctx).Debug().Str("query_type", "Scan").Str("operation", "count_ids").Msg("CountIDs: starting")

	ctx = setContextOp(ctx, sq.ctx, ent.OpQueryIDs)

	ids, err := sq.IDs(ctx)
	if err != nil {
		logx.FromContext(ctx).Error().Err(err).Str("query_type", "Scan").Str("operation", "count_ids").Msg("CountIDs: IDs() failed")

		return 0, err
	}

	logx.FromContext(ctx).Debug().Str("query_type", "Scan").Str("operation", "count_ids").Int("count", len(ids)).Msg("CountIDs: completed")

	return len(ids), nil
}

